:- module(color,[coloring/2]).

% ?- bench([\+coloring(static,_,5)]).

:-use_module(library(trees)).
:-use_module(library(lists), [keyclumped/2]).
:-use_module(library(clpfd)).

%%%%%%%%%%%%%%%%%%%%%%%%%%%

coloring(dynamic, K) :-
	graph(Nodes, Edges),
	length(Nodes, N),
	length(Colors, N),
	domain(Colors, 1, K),
	list_to_tree(Colors, Tree),
	keyclumped(Edges, Clumps),
	(   foreach(A-L,Clumps),
	    param(Tree)
	do  get_label(A, Tree, AL),
	    (   foreach(B,L),
		param([AL,Tree])
	    do  get_label(B, Tree, BL),
		AL #\= BL
	    )
	),
	labeling([ff,enum], Colors),
	writeq(Colors),
	nl.
coloring(static, K) :-
	graph(Nodes, Edges),
	length(Nodes, N),
	length(Colors, N),
	domain(Colors, 1, K),
	list_to_tree(Colors, Tree),
	keyclumped(Edges, Clumps),
	(   foreach(A-L,Clumps),
	    param(Tree)
	do  get_label(A, Tree, AL),
	    (   foreach(B,L),
		param([AL,Tree])
	    do  get_label(B, Tree, BL),
		AL #\= BL
	    )
	),
	(   foreach(Node,Nodes),
	    foreach(V,Vars),
	    param(Tree)
	do  get_label(Node, Tree, V)
	),
	color_labeling(Vars, 0, K),
	writeq(Colors),
	nl.

color_labeling(Vars, K, K) :- !,
	labeling([enum], Vars).
color_labeling([], _, _).
color_labeling([V|Vars], Max, K) :-
	V #=< Max+1,
	indomain(V),
	Max1 is max(Max,V),
	color_labeling(Vars, Max1, K).

/***
vertex_order(Order) :-
	graph(_, Edges1),
	(   foreach(A-B,Edges1),
	    foreach(B-A,Edges2)
	do  true
	),
	append(Edges1, Edges2, Edges3),
	sort(Edges3, Edges4),
	keyclumped(Edges4, VertNeibs),
	vertex_order(VertNeibs, Order, []).

vertex_order([]) --> !.
vertex_order(VertNeibs1) -->
	{   foreach(V-Ns,VertNeibs1),
	    foreach(K-V,DI1)
	do  length(Ns, K)
	},
	{keysort(DI1, DI2)},
	{DI2 = [_-Vertex|_]},
	{filter(VertNeibs1, Vertex, VertNeibs2)},
	vertex_order(VertNeibs2),
	[Vertex].

filter([], _, []).
filter([V-Ns1|Es1], F, [V-Ns2|Es2]) :-
	V=\=F, !,
	delete(Ns1, F, Ns2),
	filter(Es1, F, Es2).
filter([_|Es1], F, Es2) :-
	filter(Es1, F, Es2).
***/

